def cols_to_rows(example_data: dict[str, list[float | str] | None]) -> tuple[list[str], list[list[float | str]]]:
    headers = list(example_data.keys())
    max_len = max([len(v) for v in example_data.values()])
    rows = []
    for i in range(max_len):
        row = []
        for key in headers:
            if i < len(example_data[key]):
                if example_data[key][i] is not None:
                    row.append(example_data[key][i])
                else:
                    row.append('NaN')
            else:
                row.append('NaN')
        rows.append(row)
    return headers, rows

def _get_version_from_file(dist_file: Path) -> Optional[str]:
    version_pattern = r"(\d+\.\d+\.\d+)"  # Define the pattern to search for version number
    file_name = dist_file.name  # Get the file name from the Path object
    match = re.search(version_pattern, file_name)  # Search for the version pattern in the file name
    if match:
        return match.group(1)  # Return the matched version number
    else:
        return None  # Return None if no version number is found

