def download_if_url(article: str) -> str:
    parsed_url = urllib.parse.urlparse(article)
    if parsed_url.scheme in ['http', 'https']:
        try:
            response = urllib.request.urlopen(article)
            return response.read().decode('utf-8')
        except:
            return article
    else:
        return article

