def sanitize_value_for_csv(value: (str | float)) -> (str | float):
    if isinstance(value, (int, float)):
        return value
    elif isinstance(value, str):
        unsafe_prefixes = ['=', '+', '-', '@', '\t', '\n']
        unsafe_sequences = [',=', ',+', ',-', ',@', ',\t', ',\n']
        if value.startswith(tuple(unsafe_prefixes)) or any(seq in value for seq in unsafe_sequences):
            return f"'{value}'"
        else:
            return value

def _parse_file_size(size: (str | int | None)) -> (int | None):
    if size is None:
        return None
    if isinstance(size, int):
        return size
    units = {"B": FileSize.B, "KB": FileSize.KB, "MB": FileSize.MB, "GB": FileSize.GB, "TB": FileSize.TB}
    match = re.match(r"(\d+)\s*(\w+)", size)
    if match:
        value, unit = match.groups()
        if unit not in units:
            raise ValueError(f"Invalid unit: {unit}")
