def append_unique_suffix(name: str, list_of_names: list[str]):
    if name not in list_of_names:
        return name
    else:
        suffix = 1
        new_name = f"{name}_{suffix}"
        while new_name in list_of_names:
            suffix += 1
            new_name = f"{name}_{suffix}"
        return new_name

